import React from 'react';

function Footer() {
  return (
    <footer id="footer" className="footer">
      <div className="container copyright text-center mt-4">
        <p>&copy; <span>Copyright</span> <strong className="px-1">Choripan-HTML</strong> <span>All Rights Reserved</span></p>
      </div>
    </footer>
  );
}

export default Footer;
